import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph, Text } from 'react-native-paper';

const RestaurantCard = (props) => (
    <Card style={{ height: 220, width: 350, marginTop: 15, marginBottom: 15, elevation: 5, shadowColor: "#000",shadowOffset: {
        width: 0,
        height: 2,
    },shadowOpacity: 0.25, shadowRadius: 3.84, }} >
        <Card.Cover source={{ uri: props.img }} style={{ height: 150, width: 350, }} />
        <Card.Content>
            <Title>{props.name}</Title>
            <Paragraph>{props.foodType} cuisine</Paragraph>
        </Card.Content>

    </Card>
);

export default RestaurantCard;

